const clickNext = (length, stoppped, stores) => {
    var showIt = [];
    var i;
    if (length >= 3) {
        for (i = 0; i <3; i++) {
            showIt[i] = stores[stoppped-1];
        }
    }
    else {
        for (i = stoppped; i >=0; i--) {
            showIt[stoppped-i] = stores[i];
        }
    }
    return showIt;
}
export default clickNext;
